package Assignments2;

public class Assignments2_Arrays3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		/*
		Create a 2D array of integers with a size of 3x3. Populate the array with values of
		your choice and print each element of the array to the console.For the 2D array of
		integers, you could use: {{1, 2, 3}, {4, 5, 6}, {7, 8, 9}}.
		
		*/
		
		int integers[] [] = {{1, 2, 3}, {4, 5, 6}, {7, 8, 9}};
		System.out.println(integers[0][0]);
		System.out.println(integers[0][1]);
		System.out.println(integers[0][2]);
		System.out.println(integers[1][0]);
		System.out.println(integers[1][1]);
		System.out.println(integers[1][2]);
		System.out.println(integers[2][0]);
		System.out.println(integers[2][1]);
		System.out.println(integers[2][2]);
		
			

	}

}
